DROP TABLE IF EXISTS "student";
DROP TABLE IF EXISTS "promo";

CREATE TABLE IF NOT EXISTS "promo" (
  "id" INT NOT NULL PRIMARY KEY,
  "name" VARCHAR(128),
  "github_organization" VARCHAR(255)
);
/*
En SQL il existe plusieurs format pour stocker du texte

TEXT: on peut y insérer un texte de longueur variable de 0 à Beaucoup
VARCHAR: est toujours allier à une longueur, qui determine la longueur maximal de caractères que le champ peut accueillir
CHAR: est toujours allier à une longuer, qui determine la longueur maximale et minimale de caractères que le champ peut accueillir
BLOB: c'est comme le texte mais l'encodage est différent (binaire)
*/


CREATE TABLE IF NOT EXISTS "student" (
  "id" SERIAL PRIMARY KEY,
  "first_name" VARCHAR(128),
  "last_name" VARCHAR(128),
  "github_username" VARCHAR(255),
  "profile_picture_url" VARCHAR(255),
  "promo_id" INT REFERENCES "promo"("id")
);

